import React from 'react'

const Guess = (props) => {
  return (
    <div class='grid grid-cols-5 gap-1'>
      <h1>guess </h1>
      {new Array(10).fill(0).map((_,i)=>(
        <div>{props.guess[i]}</div>
      ))}
    </div>
  )
}

export default Guess
